import './App.css';
import PersonIcon from '@material-ui/icons/Person';
import IconButton from '@material-ui/core/IconButton';

function App() {
  return (
    <div className="app">
      <h1>
       I am a header
      </h1>
      <IconButton>
        <PersonIcon fontSize="large" className="header__icon"/>
      </IconButton>

    </div>
  );
}

export default App;
